export const fetchDogs = async (dispatch) => {
  return fetch("http://localhost:3001/dogs").then((d) => d.json()).then((res) => dispatch({ type: fetchDogs, payload: res }));
  
};
export const getAllHouses = () => async dispatch => {
    const response = await fetch('http://localhost:3000/houses');
    const json = await response.json();
    return dispatch({ type: GET_ALL_HOUSES, payload: json }); 
};
